import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <div>
      <h1>Welcome to OSRS Challenge Hub</h1>
      <p>
        Ready for challenges? Click{' '}
        <Link to="/challenges" style={{ color: 'blue', textDecoration: 'underline' }}>
          here
        </Link>{' '}
        to check them out!
      </p>
    </div>
  );
}
